import React from 'react'

const FunEvents = props => {
  const { icon, title } = props
  return (
    <div className="column">
      <figure className="image is-64x64">
        <img className="is-rounded" src={props.icon} alt={props.title} />
      </figure>
    </div>
  )
}

export default FunEvents
